import React from "react";
import Footer from "../components/footer/footer";
import Header from "../components/header/header";
import MainPreview from "../components/mainPreview/mainPreview";

const MainPage = () => {
  return (
    <>
      <Header />
      <MainPreview />
      <Footer />
    </>
  );
};

export default MainPage;
